configure:
  commands:
    end:
      new_state: execute
    interface Port-channel 93: "interface Port-channel 93\r\n"
    ip dhcp snooping information option allow-untrusted: "ip dhcp snooping information\
      \ option allow-untrusted\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: access(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: access(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: access#
